func TestRanges(t *testing.T) {
	ranges := Ranges{r: []uint32{1, 2, 3, 4}}

	n := ranges.Len()
	if n != 2 {
		t.Errorf("unexpected length: %d", n)
	}
	for i := 0; i < n; i++ {
		rng := ranges.At(i)
		if rng.LowerBound != int(ranges.r[2*i]) || rng.UpperBound != int(ranges.r[2*i+1]) {
			t.Errorf("unexpected range for index %d: %v", i, rng)
		}
	}
}

func TestPluralRules(t *testing.T) {
	collectRules := func(r PluralRules) []PluralRule {
		var res []PluralRule
		r.Iter(func(rule PluralRule) {
			res = append(res, rule)
		})
		return res
	}

	rules := PluralRules{}
	collected := collectRules(rules)
	if len(collected) != 0 {
		t.Errorf("unexpected plural rules: %+v", collected)
	}

	rules = PluralRules{
		rel: relation{0x1285, 0x1, 0x1, 0x1000},
	}
	collected = collectRules(rules)
	expected := []PluralRule{
		{Operand: IntegerDigits, ModuloExp: 2, Operator: NotEqual, Ranges: Ranges{r: []uint32{0x1, 0x1}}, Connective: Conjunction},
		{Operand: IntegerDigits, ModuloExp: 0, Operator: Equal, Ranges: Ranges{r: []uint32{}}, Connective: None},
	}
	if !reflect.DeepEqual(collected, expected) {
		t.Errorf("unexpected plural rules: %+v", collected)
	}
}

